import CookieManager from "./cookies/CookieManager";
import './App.css';


const App = () => {
    return(
        <Router>
            <CookieManager>
                <UserContext>
                    {/* <Route path="/" component={MainContentArea}/> */}
                    <MainContentArea/>
                </UserContext>
            </CookieManager>
        </Router>
    );
}

export default App;
